DECLARE @CODIGO nvarchar(max), @DESCRIPCION  nvarchar(max),@PRES  nvarchar(max)  
 
DECLARE  nombre_cursor  CURSOR 
FOR
SELECT   CODIGO
      ,[DESCRIPCION]
      ,[PRES]
       
  FROM [BDGRPNET].[dbo].[MedGenerico]
-- apertura del cursor
OPEN nombre_cursor  
	-- Lectura de la primera fila del cursor
	FETCH  nombre_cursor  INTO  @CODIGO ,  @DESCRIPCION ,@PRES
	WHILE (@@FETCH_STATUS = 0)
		BEGIN	
		DECLARE  @NroCorrelativo int,  @codigoGE varchar(20)
		exec S_Genera_Codigo2  'TB_PRODUCTO_SERVICIO',@NroCorrelativo output 
		set @codigoGE =   right(year(getdate()),2)  +  right('00000000000000000'+ LTRIM(RTRIM(@NroCorrelativo))  ,10)
		insert into TB_PRODUCTO_SERVICIO values(@codigoGE ,@DESCRIPCION ,@CODIGO,@PRES,'PROD' )
		-- Lectura de la siguiente fila de un cursor
		FETCH nombre_cursor INTO @CODIGO ,  @DESCRIPCION ,@PRES
	END -- Fin del bucle WHILE
-- Cierra el cursor
CLOSE nombre_cursor 
-- Libera los recursos del cursor
DEALLOCATE  nombre_cursor


 